--
-- Table structure for table `pedidos`
--

DROP TABLE IF EXISTS `pedidos`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `pedidos` (
  `IdPedido` int(10) NOT NULL,
  `IdCliente` varchar(5) DEFAULT NULL,
  `IdEmpleado` int(10) DEFAULT NULL,
  `FechaPedido` datetime DEFAULT NULL,
  `FechaEntrega` datetime DEFAULT NULL,
  `FechaEnvío` datetime DEFAULT NULL,
  `FormaEnvío` int(10) DEFAULT NULL,
  `Cargo` decimal(19,4) DEFAULT NULL,
  `Destinatario` varchar(40) DEFAULT NULL,
  `DirecciónDestinatario` varchar(60) DEFAULT NULL,
  `CiudadDestinatario` varchar(15) DEFAULT NULL,
  `RegiónDestinatario` varchar(15) DEFAULT NULL,
  `CódPostalDestinatario` varchar(10) DEFAULT NULL,
  `PaísDestinatario` varchar(15) DEFAULT NULL,
  PRIMARY KEY (`IdPedido`),
  KEY `FechaPedido` (`FechaPedido`),
  KEY `EmpleadosPedidos` (`IdEmpleado`),
  KEY `Compañías de envíosPedidos` (`FormaEnvío`),
  KEY `ClientesPedidos` (`IdCliente`),
  CONSTRAINT `ClientesPedidos` FOREIGN KEY (`IdCliente`) REFERENCES `clientes` (`IdCliente`) ON DELETE CASCADE ON UPDATE CASCADE,
  CONSTRAINT `Compañías de envíosPedidos` FOREIGN KEY (`FormaEnvío`) REFERENCES `companias de envios` (`IdCompañíaEnvíos`),
  CONSTRAINT `EmpleadosPedidos` FOREIGN KEY (`IdEmpleado`) REFERENCES `empleados` (`IdEmpleado`)
) ENGINE=InnoDB DEFAULT CHARSET=latin1;
/*!40101 SET character_set_client = @saved_cs_client */;

